import React from 'react';
import './index.scss';
import { ClockCircleOutlined } from '@ant-design/icons';
import { Timeline } from 'antd';
import { useAppDispatch, useAppSelector } from '../../../hooks/utils';
import { selectUserList } from '../../../counter/usersSlice';

interface DateTour {
  start: Date;
  finish: Date;
}

interface ToursPlan {
  city: string;
  desc: string;
  ticket: [];
  hotel: [];
  dates: DateTour;
}

interface TourPlanProps {
  arr: {
    plan: ToursPlan[];
  };
}

const TimeLineItem: React.FC<ToursPlan> = (item) => {
  const { city, dates, desc } = item;
  const getDates = () => {
    const firstDate = dates.start;
    const lastDate = dates.finish;
    return `${firstDate.toLocaleString('en', {
      month: 'short',
    })} ${firstDate.getDate()} - ${
      firstDate.getMonth() === lastDate.getMonth()
        ? ''
        : lastDate.toLocaleString('en', { month: 'short' })
    }  ${lastDate.getDate()}`;
  };

  return (
    <div className="plan-item">
      <p className="date">{getDates()}</p>
      <h4 className="city">{city}</h4>
      <div className="hotel-list">
        <div className="hotel-item">
          <svg
            width="16"
            height="16"
            viewBox="0 0 16 16"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            <rect
              width="16"
              height="16"
              fill="url(#pattern0)"
              fillOpacity="0.5"
            />
            <defs>
              <pattern
                id="pattern0"
                patternContentUnits="objectBoundingBox"
                width="1"
                height="1"
              >
                <use
                  xlinkHref="#image0_135_394"
                  transform="scale(0.00195312)"
                />
              </pattern>
              <image
                id="image0_135_394"
                width="512"
                height="512"
                xlinkHref="data:image/png;base64,"
              />
            </defs>
          </svg>
          <p> Hotel President</p>
        </div>
      </div>
      <div className="ticket-list">
        <div className="ticket-item">
          <svg
            width="16"
            height="16"
            viewBox="0 0 16 16"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink"
          >
            <rect
              width="16"
              height="16"
              fill="url(#pattern0)"
              fillOpacity="0.5"
            />
            <defs>
              <pattern
                id="pattern0"
                patternContentUnits="objectBoundingBox"
                width="1"
                height="1"
              >
                <use
                  xlinkHref="#image0_135_398"
                  transform="scale(0.00195312)"
                />
              </pattern>
              <image
                id="image0_135_398"
                width="512"
                height="512"
                xlinkHref="data:image/png;base64,"
              />
            </defs>
          </svg>

          <p>
            ticket <a href="">PDF.bookinghotel</a>
          </p>
        </div>
      </div>
      <div className="note">
        <h6 className="note-title">Note</h6>
        <p>{desc}</p>
      </div>
    </div>
  );
};

const Plan: React.FC<TourPlanProps> = ({ arr }) => {
  const { plan } = arr;

  return (
    <div className="plan">
      <div className="container">
        <div className="plan-list">
          <Timeline
            mode="left"
            items={plan.map((item) => {
              return {
                children: <TimeLineItem {...item} />,
                class: 'plan-item',
              };
            })}
          />
        </div>
      </div>
    </div>
  );
};
export default Plan;
